import Header from "../Header";
import "./dashboard.css"
function Dashboard(){

    window.onload = function load (){
      if(sessionStorage.getItem("name")=="" || sessionStorage.getItem("name")==null ){
        window.location.href="/Signup";
      }
      var view = document.querySelector("#name")

      console.log(view);

      view.innerHTML = sessionStorage.getItem("name").toUpperCase()+" "+sessionStorage.getItem("lastname").toUpperCase();

     var logologo= document.querySelector("#logo-logo");
     console.log(logologo)
     logologo.style.display="none";
    }


    return(
      <div>
        <h3 style={{textAlign:"center"}}>Hello, welcome Agent <span id="name"> </span> </h3>
        <p className="names" id="nn3"> </p>
      <div id="container">


        <div className="personal information" style={{textAlign:"left"}}>
          <p>Fullname:{" "+localStorage.getItem("name")+""}  {localStorage.getItem("lastname")}<br></br></p>
          <p>State Of Origin: {""+localStorage.getItem("SOO")}</p>
          <p>Age: {""+localStorage.getItem("age")}</p>
          <p>Jobtype: {""+localStorage.getItem("jobtype")}</p>
          <p>Status: Unemployed</p>
          <p>Phone Number: {""+localStorage.getItem("pnumber")}</p>



        </div>



        </div>
        <div id="available_jobs">
        <h3 style={{textAlign:"center"}}>Available Jobs Near me</h3>
        </div>
      </div>
    );
  }

  export default Dashboard;
